import React, { useState, useEffect } from 'react';

const ManageCurrencies = () => {
    const [currencies, setCurrencies] = useState([]);
    const [exchangeRates, setExchangeRates] = useState([]);
    const [code, setCode] = useState('');
    const [name, setName] = useState('');
    const [interval, setInterval] = useState(60);

    useEffect(() => {
        fetch('http://localhost:8000/api/currencies/')
            .then(response => response.json())
            .then(data => setCurrencies(data));

        fetch('http://localhost:8000/api/exchange-rates/')
            .then(response => response.json())
            .then(data => setExchangeRates(data));
    }, []);

    const handleSubmit = (e) => {
        e.preventDefault();
        fetch('http://localhost:8000/api/currencies/', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ code, name, interval_minutes: interval }),
        })
            .then(response => response.json())
            .then(data => {
                setCurrencies([...currencies, data]);
                setCode('');
                setName('');
                setInterval(60);
            });
    };

    return (
        <div>
            <h1>Manage Currencies</h1>
            <form onSubmit={handleSubmit}>
                <input
                    type="text"
                    placeholder="Currency Code"
                    value={code}
                    onChange={(e) => setCode(e.target.value)}
                />
                <input
                    type="text"
                    placeholder="Currency Name"
                    value={name}
                    onChange={(e) => setName(e.target.value)}
                />
                <input
                    type="number"
                    placeholder="Interval (minutes)"
                    value={interval}
                    onChange={(e) => setInterval(e.target.value)}
                />
                <button type="submit">Add Currency</button>
            </form>
            <h2>Currencies</h2>
            <table className="table">
                <thead>
                    <tr>
                        <th>Code</th>
                        <th>Name</th>
                        <th>Interval (minutes)</th>
                    </tr>
                </thead>
                <tbody>
                    {currencies.map((currency, index) => (
                        <tr key={index}>
                            <td>{currency.code}</td>
                            <td>{currency.name}</td>
                            <td>{currency.interval_minutes}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
            <h2>Exchange Rates</h2>
            <table className="table">
                <thead>
                    <tr>
                        <th>Currency</th>
                        <th>Rate</th>
                        <th>Last Updated</th>
                    </tr>
                </thead>
                <tbody>
                    {exchangeRates.map((rate, index) => (
                        <tr key={index}>
                            <td>{rate.currency}</td>
                            <td>{rate.rate}</td>
                            <td>{new Date(rate.updated_at).toLocaleString()}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default ManageCurrencies;
